import styled from 'styled-components';
export const Div0 = styled.div`
    width: 100%;
    min-width:1250px;
    margin: 0 auto;
    height:60px;
    background-color:#445553;
    display: grid;
    grid-template-columns:100px 100px 8fr 1fr 1fr 1fr;

`
export const Logo=styled.div`
    padding-left:5px;
    width:100px;
    float:left;
`;
export const Personal=styled.a`
    font-size:20px;
    color:white;
    font-family: 'Noto Sans TC', sans-serif;
    width: 70px;
    margin-top: 20px;
`
export const AllData=styled.a`
    font-size:20px;
    color:white;
    font-family: 'Noto Sans TC', sans-serif;
    width: 50px;
    margin-top: 20px;
`
export const Exit=styled.a`
    font-size:20px;
    color:white;
    font-family: 'Noto Sans TC', sans-serif;
    width: 50px;
    margin-top: 20px;
    float:right;
`
export const Whitediv=styled.div`
    font-size:20px;
    color:white;
    font-family: 'Noto Sans TC', sans-serif;
    width: 50px;
    margin-top: 20px;
    float:right;
`
export const LogoText=styled.p`
    font-size:24px;
    color:white;
    font-family: 'Noto Sans TC', sans-serif;
    width: 120px;
    margin-top: 27px;
    float:left;
`;
